import React from 'react';
import Router from './Router';
import { ThemeContext } from './Contexts';
import useTheme from './Themes/Theme';

const App = () => {
	const theme = useTheme();

	return (
		<ThemeContext.Provider value={theme}>
			<Router />
		</ThemeContext.Provider>
	);
};

export default App;
